import store from "./store";

export function FirstBarUp() {
  store.firsttop--;
}

export function FirstBarDown() {
  store.firsttop++;
}

export function SecondBarUp() {
  store.secondtop--;
}

export function SecondBarDown() {
  store.secondtop++;
}
